import React from 'react'
import {StyleSheet, View} from 'react-native'

const Navbar = () =>{
    return (
        <View style={styles.navbar}>
            
        </View>
    )
}

const styles = StyleSheet.create({
    navbar:{
        height: "20vh",
        backgroundColor: "blue",
        flex: 1,
    }
})

export default Navbar
